import React from "react";
import { Link } from "react-router-dom";
import "../Design/Header.css";
import Logo from "../Images/LOGO.svg";
import joystick from "../Images/joy_stick.png";
import Homeline from "../Images/HomeLine.svg";
import Cry from "../Images/cry.svg";
import Unity from "../Images/unity.svg";
import Unreal from "../Images/unreal.svg";


function Header() {
  return (
    <div className="maindiv">
      <img src={Logo} className="headlogo"></img>

      <div className="bothlink">
        <div className="links">
          <Link to="#">Home</Link>
          <Link to="#">About us</Link>
          <Link to="#">Portfolio</Link>
          <Link to="#">News</Link>
        </div>
        <div className="contactlink">
          <Link to="#" className="btn-contact">
            Contact us
          </Link>
        </div>
      </div>

      <img src={joystick} className="joystick"></img>
      <img src={Homeline} className="h"></img>
      <img src={Cry} className=""></img>
      <img src={Unity} className=""></img>
      <img src={Unreal} className=""></img>
    </div>
  );
}

export default Header;
